import './App.css';

async function App() {
  const res = await fetch(`https://dummyjson.com/products?limit=100`)

  const fetchData = async () => {
    const res = await fetch(`https://dummyjson.com/products?limit=100`)
    const data = await res.json()
    console.log(data)
  }

  return (
    <div className="App">
      Array.from(data).map((item, index) => {
        <div key={index}>
          <h1>{item.name}</h1>
          <p>{item.price}</p>
        </div>
      })
    </div>
  )


}

export default App;
